  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Chase
  Lake WMD, Chase Lake NWR, Chase Lake Prairie Project, and Halfway Lake NWR outlines
  Refuge accomplishments during the 1997 calendar year. The report begins with a summary
  of the year's highlights and weather conditions. Land acquisition is covered. The
  report includes a planning section which discusses management planning, compliance
  with environmental and cultural resource mandates, and research and investigations.
  Refuge administration is outlined; information about personnel, youth programs,
  volunteer programs, funding, safety, and technical assistance is given. Habitat
  management is also covered; subjects include wetlands, croplands, grasslands, grazing,
  haying, fire management, pest control, water rights, wilderness areas, and WPA easements.
  The wildlife section of the report discusses wildlife diversity, endangered and
  threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
  game mammals, fisheries resources, animal control, marking and bird banding, and
  disease control. The public uses of the Refuge described in this report include
  interpretive programs, hunting, fishing, trapping, outdoor recreation, and law enforcement.
  The equipment and facilities section of the report provides information about new
  construction, rehabilitation, equipment replacement, and computer systems. Cooperative
  programs, economic uses of the Refuge, and items of interest are provided at the
  end. Refuge brochures are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
